import React from "react";
import './Navbar.css';

const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="navbar-logo">
                <img src={logo} alt="Knofhub Logo"></img>
            </div>
        </nav>
    );
};

export default Navbar;
